import React from 'react';
import TelaUm from '../Pages/TelaUm';
import TelaDois from '../Pages/TelaDois';
import TelaTres from '../Pages/TelaTres';
import './CSS/HeaderStyle.css';

function HeaderForms() {
  return (
    <header>
      <h1 class="title">Team Sign Up</h1>
      <nav class="navegacao">
        <ul>
          <li><a href={linkAtual}>Basic</a></li>
          <li class="active"><a href={link}>Social</a></li>
          <li><a href={link}>Certificates</a></li>
        </ul>
      </nav>
    </header>
  );
}
export default HeaderForms;
